import { TableMain, Th, Td } from "../style/table";

const Table = (data, column) => {
  return (
    <div>
      <TableMain>
        <thead>
          <tr>
            {column.map((item, index) => (
              <TableHeadItem item={item} />
            ))}
          </tr>
        </thead>
        <tbody>
          <tr>
            <Td></Td>
            <Td></Td>
          </tr>
        </tbody>
      </TableMain>
    </div>
  );
};

const TableHeadItem = ({ item }) => <th>{item.heading}</th>;

export default Table;
